if($.cookie("admin-bar-status")=="expanded"){$("#admin-bar").css("width","100%").removeClass("admin-bar-collapsed").addClass("admin-bar-expanded")}$adminBarW=$("#admin-bar").width();$adminBarH=$(".admin-bar-toggle").height();$(".admin-bar-toggle").click(function(){var b=$(this),a=b.closest("#admin-bar");if(a.hasClass("admin-bar-collapsed")){a.animate({width:"100%"},1400);a.find("ul").animate({left:"+="+$adminBarW},1800,function(){a.removeClass("admin-bar-collapsed").addClass("admin-bar-expanded")});$.cookie("admin-bar-status","expanded")}else{a.find("ul").animate({left:"-="+$adminBarW},500,function(){a.addClass("admin-bar-collapsed").removeClass("admin-bar-expanded")});a.delay(400).animate({width:"30"},1000);$.cookie("admin-bar-status","collapsed")}return false});